定期的にチェックする「タカノフルーツパーラー」のシーズナルメニュー
そして、見つけた
「シャインマスカットのパフェ」
ついにこの日が来た、と思いました
わたしはシャインマスカットを食べたことがないのです
誰もが「めちゃくちゃおいしい！」と話す、シャインマスカット
シャインマスカットデビューには名門タカノがふさわしい、そう思いました
お店まで、車で30分、シャインマスカットのことだけ考え運転しました
店内に入り、席に座る
シャインマスカットに決まってるんだけど、一応メニューを見る
するとそこには、あろうことか、HPには載っていなかった「栗のパフェ」の文字
いやいや、人生初のシャインマスカットを食べにここまで来たんだろ、と自分を一生懸命励ます
1秒くらい激しく迷って、口から出たのは「栗のパフェ」の一言でした
