9月の十六夜(いざよい)﻿
﻿
date 2020.9.3﻿
location  姫路城﻿
﻿
お久しぶりの投稿です🙇‍♀️﻿
﻿
この日は、﻿
「カミナリ落ちるかなぁ〜？」﻿
とカメラ仲間に連絡したところ、﻿
「今日は焼けますよ〜」って😍﻿
主人にお願いして、撮影に出れたのですが、﻿
狙っていた構図の空は焼けず😱﻿
﻿
お月さまと姫路城を狙いに行きました！﻿
﻿
しかし！ここでもまた厚い雲に覆われてお月さま見えず😱諦めて帰ろうとしたところ、うっすら雲から光が…！場所を移動して、お月さまと姫路城を撮ることができました＼(^o^)／﻿
﻿
夕方以降撮影に行けるチャンスがほぼない私にとっては、撮れたことが最高でルンルン🎶だったのですが、﻿
次の日、パソコンに取り込む際、「このカードは読み込めません。フォーマットしてください」の警告が﻿
😨😨😨﻿
﻿
他機種に使っていたSDカードをフォーマットせずに使ったので読み込めませんでした😭﻿
﻿
撮影中に携帯に転送したJPEGデータが1枚だけあったので泣く泣く現像しましたが、ムリ…
計算では左下の雲を鮮明にして木のシルエットのディテールを強調したかったのに😢﻿

記念に投稿します🤗﻿
